var y={L:'<h1>Overview</h1>\n<p>Most selection widgets care about two data points: what is selectable and what\nis selected.</p>\n<p>In ACX selection widgets, what is selectable is represented by the\n<a href="https://github.com/angulardart/angular_components/blob/master/angular_components/lib/model/selection/selection_options.dart"><code>SelectionOptions</code></a>\ninterface, while what is selected is represented by the\n<a href="https://github.com/angulardart/angular_components/blob/master/angular_components/lib/model/selection/selection_model.dart"><code>SelectionModel</code></a>\ninterface.</p>\n<p>Material Auto Suggest Input is an input field which provides suggestions to\nauto-complete the input as the user types. It uses these two interfaces via the\n<code>selectionOptions</code> and <code>selection</code> inputs, but additionally it has <code>inputText</code>\nwhich presents the text the user has entered.</p>\n<p>Which input combinations to use for Material Auto Suggest Input depends on your\nuse case.</p>\n<p>If you are using the component to accept user entered content, and the list of\noptions is used to assist content entry, you want to use <code>selectionOptions</code> and\n<code>inputText</code>. Together with the <code>inputTextChange</code> output, you can setup two-way\nbinding for the input text.</p>\n<p>HTML:</p>\n<pre><code class="language-html">&lt;material-auto-suggest-input\n    [selectionOptions]="myOptions"\n    [(inputText)]="myInput"\n    ...&gt;\n&lt;/material-auto-suggest-input&gt;\n</code></pre>\n<p>Dart:</p>\n<pre><code class="language-dart">class MyView {\n  final myOptions = [\'Foo\', \'Bar\', \'Baz\'];\n  String myInput = \'Bar\';\n}\n</code></pre>\n<p>If you are using the component to select one or more items from a list of\noptions, and the input is used for filtering, you want to use <code>selectionOptions</code>\nand <code>selection</code>. Together with the <code>selectionChange</code> output, you can setup\ntwo-way binding for the selected value.</p>\n<p>HTML:</p>\n<pre><code class="language-html">&lt;material-auto-suggest-input\n    [selectionOptions]="myOptions"\n    [(selection)]="mySelection"\n    ...&gt;\n&lt;/material-auto-suggest-input&gt;\n</code></pre>\n<p>Dart:</p>\n<pre><code class="language-dart">class MyView {\n  final myOptions = [1, 2, 3];\n  int mySelection = 2;\n}\n</code></pre>\n<h1>The selectionOptions input</h1>\n<p>The <code>selectionOptions</code> input accepts either a <code>SelectionOptions</code> class or a\ngeneric <code>List</code>.</p>\n<p>If a <code>List</code> is passed, a\n<a href="https://github.com/angulardart/angular_components/blob/master/angular_components/lib/model/selection/string_selection_options.dart"><code>StringSelectionOptions</code></a>\nwill be created with the list and the <code>ItemRenderer</code> if specified to support\nbasic filtering.</p>\n<p>If you need more advanced features, like grouped options, custom filtering or\nasync search, you could also pass an implementation of <code>SelectionOptions</code>.</p>\n<h1>The selection input &amp; output</h1>\n<p>The <code>selection</code> input accepts either a <code>SelectionModel</code>, a selected value or\nnull.</p>\n<p>By default Material Auto Suggest Input uses\n<a href="https://github.com/angulardart/angular_components/blob/master/angular_components/lib/src/model/selection/single_selection_model_impl.dart"><code>SingleSelectionModel</code></a>.\nIf a selected value is passed to the <code>selection</code> input, this value will be\nselected by the default selection model. If a null value is passed to the input,\nthe default selection model will clear the selection.</p>\n<p>If you need to use a <code>MultiSelectionModel</code> or a custom implementation of\n<code>SelectionModel</code>, you could also use the same input.</p>\n<p>The <code>selectionChange</code> output emits the selected value(s) whenever selection\nchanges. For single select, it will either be the selected value or null. For\nmulti select, it will a list of selected values or an empty list.</p>\n<p>For simpler single select use cases, you can use the <code>[(selection)]</code> syntax to\nsetup two-way binding for your selected value.</p>\n',K:"<p><code>FactoryRenderer</code> used to display the item.</p>\n",P:"<p>A custom CSS class for suggestion popup contents.</p>\n",w:"<p>A custom character counter function.</p>\n<p>Takes in the input text; returns how many characters the text should be\nconsidered as.</p>\n",c:"<p>A simple function to render the an item to string.</p>\n",o:"<p>Allow filtering of suggestions as the user is typing.</p>\n<p>When <code>false</code> always show the full list of suggestions.\nDefaults to true.</p>\n",I:"<p>Any persistent glyph to show at the end of the input box.</p>\n",s:"<p>Any persistent glyph to show before the input box.</p>\n",y:"<p>Any text to show at the leading edge of the input -- e.g. a currency\nsymbol or similar.</p>\n",S:"<p>Any text to show at the trailing edge of the input -- e.g. a currency\nsymbol or similar.</p>\n",i:"<p>Custom error message to show when the field is required and blank.</p>\n",D:"<p>Custom factory for rendering suggestion labels.</p>\n",R:"<p>Direction of popup scaling.</p>\n<p>Valid values are <code>x</code>, <code>y</code>, or <code>null</code>.</p>\n",v:"<p>Emits the selected value(s) whenever selection changes.</p>\n<p>For single select, it will either be the selected value or null.\nFor multi select, it will a list of selected values or an empty list.</p>\n",g:"<p>Error to be displayed.</p>\n<p>Higher precedent than all other errors which may be on this input.</p>\n",V:"<p>Fired when the close icon is clicked.</p>\n",X:"<p>Fired when the input gains focus.</p>\n",W:"<p>Fired when the nested MaterialInputComponent fires a blur event.</p>\n",Y:"<p>Fired when this component loses focus.</p>\n<p>This stream is fired when:</p>\n<ol>\n<li>the underlying material input blurs, if there is no popup and\nthere are subscribers to the blur stream</li>\n<li>the suggestions popup closes and there is no focus on the\nunderlying material input</li>\n</ol>\n",q:"<p>Function which returns a list of <code>HighlightedTextSegment</code> for the given\nquery and value.</p>\n<p>If no <code>optionHighlighter</code> is provided, a <code>TextHighlighter</code> is used in\nconjunction with the <code>itemRenderer</code> to produce the list of text segments.</p>\n",t:"<p>How many suggestions to show.</p>\n<p>If the limit is less than 1, it is assumed to be mean no limit.\nSee filter method in <code>Filterable</code>. Defaults to 10.</p>\n",x:"<p>List of positions to try and draw the suggest popup.</p>\n<p>See <code>MaterialPopupComponent</code> for more information.</p>\n",r:"<p>Maximum allowed characters for character counting input box.</p>\n<p>Character count always is displayed when the value is non-null.</p>\n",u:"<p>Publishes event when the showPopup changes.</p>\n",p:"<p>Publishes events when input text changes (on keypress.)</p>\n",a:"<p>See material_auto_suggest_input.md for an overview of the component.\nSee examples for usage.</p>\n",T:"<p>Sets the available options for the selection component.</p>\n<p>Accepts either a <code>SelectionOptions</code> or a <code>List</code>. If a <code>List</code> is passed,\nthe <code>StringSelectionOptions</code> class will be used to create the selection\noptions.</p>\n",e:"<p>Sets the selected value or selection model for the selection component.</p>\n<p>Accepts either a <code>SelectionModel</code>, a selected value or null.</p>\n",J:"<p>Show or hide the trailing close icon.</p>\n<p>Clicking on the icon clears the input text and hides the popup.\nDefaults to false.</p>\n",h:"<p>Text to show if the options list is empty and not loading.</p>\n",_:"<p>The autocomplete attribute for the inner input element.</p>\n<p>Defines the type of autocomplete functionality for the input. For example,\ncan be <code>on</code> or `off``..</p>\n<p>Note: Setting this field may depend on the browser implementation and is\nnot guaranteed to turn off the autocomplete functionality.</p>\n",l:"<p>The hint to be shown on the input.</p>\n<p>This text will not be displayed if there is an error message on the input.</p>\n",k:"<p>The label to use for assistive technology.</p>\n<p>If not provided, uses the label instead.</p>\n",Z:"<p>The text the input should have.</p>\n<p>Consider using the angular_forms <code>NgModel</code> instead.</p>\n",z:"<p>Used to control the visibility of the suggestion popup.</p>\n",b:"<p>When turned on and no suggestions available, show loading indicator in the\nsuggestions dropdown.</p>\n",j:"<p>Whether matches should only highlight at the start of words.</p>\n",U:"<p>Whether or not the hint text will be displayed when the input is not\nfocused.</p>\n<p>Defaults to false.</p>\n",M:"<p>Whether or not the input is required.</p>\n<p>If there's no input text, a required input will show a validation error\nwhen it's first blurred.</p>\n",C:'<p>Whether or not the label "floats".</p>\n<p>If false, the label disappears when text is entered into the box. If true,\nit instead "floats" up above the input.</p>\n',A:"<p>Whether or not the suggestion popup width is at least as wide as the input\nwidth.</p>\n<p>Defaults to false.</p>\n",B:'<p>Whether suggestions should be smartly activated / highlighted.</p>\n<p>Defaults to true.</p>\n<p>When true:</p>\n<ul>\n<li>\n<p>If <code>selection</code> has selected values, the first selected value in\n<code>options</code> is activated / highlighted when the suggestions list opens.\nJustification - "If one or more options are selected before the listbox\n                receives focus, focus is set on the first option in the\n                list that is selected".\n                <a href="https://www.w3.org/TR/wai-aria-practices/#Listbox">https://www.w3.org/TR/wai-aria-practices/#Listbox</a></p>\n</li>\n<li>\n<p>If <code>selection</code> is empty, the first value in <code>options</code> is activated /\nhighlighted when the suggestions list opens.\nJustification - "If none of the options are selected before the listbox\n                receives focus, focus is set on the first option...".\n                <a href="https://www.w3.org/TR/wai-aria-practices/#Listbox">https://www.w3.org/TR/wai-aria-practices/#Listbox</a></p>\n</li>\n<li>\n<p>If <code>selection</code> is a <code>MultiSelectionModel</code>, deactivate any active\nsuggestions when the search text changes. This does not apply for any\ntext changes caused by <code>shouldClearInputOnSelection</code> or when the\nsuggestions list opens.\nJustification - The W3 listbox spec (see above for link) says that\n                <Space> "changes the selection state of the focused\n                option" for multi-select listboxes.\n                This means that a user cannot type a space into the\n                textbox with an option focused, the space would be\n                captured and used to toggle selection instead of typing\n                a space. Clearing "focus" (deactivating) on any option\n                makes it easy for the user to type a space into the\n                textbox.</p>\n</li>\n</ul>\n<p>When false:</p>\n<ul>\n<li>\n<p>if <code>selection</code> <code>isSingleSelect</code>, don\'t auto activate / highlight any\noptions.</p>\n</li>\n<li>\n<p>if <code>selection</code> <code>isMultiSelect</code>, activate / highlight the first value\nwhen the suggestions list opens. Also, do not clear the active item when\nthe search text changes.</p>\n</li>\n</ul>\n',E:"<p>Whether the input contents should be always right aligned.</p>\n<p>Default value is <code>false</code>.</p>\n",d:"<p>Whether the popup should automatically reposition itself based on space\navailable relative to the viewport.</p>\n<p>Defaults to true.</p>\n",H:"<p>Whether to cause dropdown to be closed on activation.</p>\n<p>Defaults to true.</p>\n",Q:"<p>Whether to clamp the popup position so that it never goes offscreen.</p>\n<p>Defaults to false.</p>\n",f:"<p>Whether to clear the input text once the item is selected from the menu.</p>\n<p>Defaults to false.</p>\n",bM:"<p>Whether to clear the selected value from the selection model when the\ninput text changes.</p>\n<p>Defaults to true.</p>\n",bc:"<p>Whether to close on enter even for string non matching options.</p>\n<p>Defaults to false.</p>\n",af:"<p>Whether to display error, hint text, and character counter panel.</p>\n",ab:"<p>Whether to hide the checkbox before the selection item for multi-select.</p>\n<p>Defaults to false.</p>\n",b8:"<p>Whether to highlight options.\nDefault value is <code>true</code>.</p>\n",F:"Block width also works for multiline inputs",m:"Character counting input with custom error",da:"ComponentFactory<dynamic>* Function(dynamic)*",N:"List<HighlightedTextSegment*>* Function(String*, dynamic)*",cL:"MaterialAutoSuggestInputFullDemoComponent",b3:"MaterialAutoSuggestInputSimpleDemoComponent",G:"Use factoryRenderer instead as it is tree shakeable.",c0:"angular_components/lib/material_input/material_auto_suggest_input.dart",cC:"angular_components/lib/material_input/material_auto_suggest_input.md",n:"material-input-number-value-accessor-demo",aR:"material_input_example/lib/material_auto_suggest_input_full_demo.dart",O:"material_input_example/lib/material_auto_suggest_input_simple_demo.dart"}
